import React from 'react';
import './Contenido.css';
import text869 from './g6682.png';

const Contenido = () => {
return (

<div className="flex flex-wrap justify-content">

  <div className="tc ma6-l center ">
    <h1 className="f1-l f3-ns fw4 ttu white tracked-tight mv0">Usando esta metodologia podemos ...</h1>
  </div>

  <div className="">

    <div className="white b--black-50 mv4 ba br4 b--red">
      <img src={text869} className="ma4 db w-50 br2 br--top center " alt="Producto Ramos"/>
      <div className="pa2 ph3-ns pb3-ns">
        <div className="dt w-100 ma4 mt1">
          <h1 className="f5 f4-ns mv0">USER CENTRE</h1>
        </div>
        <p className="f6 lh-copy measure mt2 white tc">
          Ramos, Boxes, Centros de Mesa, Floreros. Arreglos personalizados.
        </p>
        <div className=" pa3 tc ">
          <a className="f3 tracked-tight dib bg-animate hover-bg-purple hover-white no-underline pv3 ph5-l br4 ba b--blue-20 blue" href="./CatalogoMarzo.pdf">CATALOGO</a>
        </div>
      </div>
    </div>



  </div>


</div>

);
}

export default Contenido;
